const InfoModal = ({data, showInfoModal, setShowInfoModal}) => {

    const handleClose = () => {
        setShowInfoModal(false)
    }

    return(
        <>
            {showInfoModal && (
                <div className='modal'>
                    <div className='modal-dialog'>
                        <div className='modal-content'>
                            <div className='modal-header'>
                                <h5 className='modal-title'>Užsakymo Informacija</h5>
                            </div>
                            <div className='modal-body'>
                                <p>{data.order_nr}</p>
                                {/* <p>{data[0].name} {data[0].lastname}</p> */}
                                <p>{data.quantity}</p>
                            </div>
                            <div className='modal-footer'>
                                <button type='submit' class='btn btn-primary' onClick={handleClose}>Uždaryti</button>
                            </div>
                        </div>
                    </div>
                </div>
            )}
        </>
    )
}

export default InfoModal;
